import React, {useEffect, useState} from 'react';
import {useParams} from "react-router-dom";
import axios from "axios";
import {Image} from "react-bootstrap";

function Mission() {

    const [missionPhotos, setMissionPhotos] = useState([]);
    let {id} = useParams();
    let rover = "";
    let sol = "";

    if (id === "spirit-mission"){
        rover = "Spirit";
        sol = Math.floor(Math.random() * 2208)
        }
    else if( id === "opportunity-mission"){
        rover = "Opportunity";
        sol = Math.floor(Math.random() * 5111)
    }
    else if( id === "curiosity-mission"){
        rover = "Curiosity";
        sol = Math.floor(Math.random() * 3134)
    }

    //try to get it to fetch until res.data.photos does not return an empty array
    useEffect(() => {
        if (missionPhotos.length === 0){
            axios.get(`https://api.nasa.gov/mars-photos/api/v1/rovers/${rover}/photos?sol=${sol}&camera=navcam&api_key=Dvef1dOc51iUgHDH93ncfcFAbriP6uDccUuTIo4x`)
                .then(res =>{
                    setMissionPhotos(res.data.photos)
                    console.log(missionPhotos)
                })
        }
        console.log(missionPhotos)
    },[missionPhotos, rover, sol])

    return (
        <div>
            <div className="mission-container">
                <div className="section-1">
                    <h1 className="mission-title">Mission Photos from {rover}</h1>
                    <p className="mission-description">Our Universe</p>
                    <div className="scroll">scroll placeholder</div>
                </div>
                <div className="section-2">
                    <h3>Legend:</h3>
                    <table>
                        <tr>
                            <th>Abbreviation</th>
                            <th>Camera</th>
                        </tr>
                        <tr>
                            <td>FHAZ</td>
                            <td>Front Hazard Avoidance Camera</td>
                        </tr>
                        <tr>
                            <td>RHAZ</td>
                            <td>Rear Hazard Avoidance Camera</td>
                        </tr>
                        <tr>
                            <td>MAST</td>
                            <td>Mast Camera</td>
                        </tr>
                        <tr>
                            <td>CHEMCAM</td>
                            <td>Chemistry and Camera Complex</td>
                        </tr>
                        <tr>
                            <td>MAHLI</td>
                            <td>Mars Hand Lens Imager</td>
                        </tr>
                        <tr>
                            <td>MARDI</td>
                            <td>Mars Descent Imager</td>
                        </tr>
                        <tr>
                            <td>NAVCAM</td>
                            <td>Navigation Camera</td>
                        </tr>
                        <tr>
                            <td>PANCAM</td>
                            <td>Panoramic Camera</td>
                        </tr>
                        <tr>
                            <td>MINITES</td>
                            <td>Minature Thermal Emission Spectrometer (Mini-TES)</td>
                        </tr>
                    </table>
                    <p>sol = one solar day on Mars (24h 39mins 35s)</p>

                    <div className="split">
                        <div className="mission-image-container">
                            <Image className="mission-image" src={apod.url} alt="daily space image" />
                            <p>{apod.date}</p>
                        </div>
                        <div className="mission-content">
                            <h3 className="mission-content-title">{apod.title}</h3>
                            <p>{apod.explanation}</p>
                        </div>
                    </div>
                    {/*{missionPhotos.map((el) =>(*/}
                    {/*    <*/}
                    {/*    ))}*/}
                </div>
            </div>

        </div>
    );
}

export default Mission;

